import React from 'react';
import profile from "./profile.jpg";
import { Link } from 'react-router-dom';
import "./navbar.css";

const Navbar = () => {
  return (
    <div className='navbar'>
        <div className="left">
              <h1 className='title'>Blog You</h1>
              <ul className='navItems'>
                  <li className='nav-item'><Link to="/" className='link'>Home</Link></li>
                  <li className='nav-item'><Link to="/register" className='link'>About</Link></li>
                  <li className='nav-item'><Link to="/register" className='link'>Contact</Link></li>
                  <li className='nav-item'><Link to="/write" className='link'>Write</Link></li>
              </ul>
        </div>
          <div className="right">
              <img src={profile} alt='profile' className='nav-img' />
              <p>Logout</p>
        </div>
    </div>
  )
}

export default Navbar;
